import {Grid, IconButton} from "@material-ui/core";
import {FacebookIcon} from "@material-ui/icons";
export default function Footer(){
    return(
    <Grid>
        <Grid item sm={12} md={6}>
            About
        </Grid>
        <Grid item sm={12} md={6}>
            Contact us
        </Grid>
        <Grid item xs={12}>
            Follow us on &nbsp;<IconButton><FacebookIcon/></IconButton>
        </Grid>
        <Grid item sm={12} md={6}>
            About
        </Grid>
        <Grid item sm={12} md={6}>
            About
        </Grid>
    </Grid>
    );
}
